import React from "react";
import {BrowserRouter as Router,Route} from 'react-router-dom';


import GenerateSch from '../GenerateSchedulePage/GenerateSchedulePage';
const Button = props => {
    return (
        <Router>
            <Route path="/" exact>
                <GenerateSch />
            </Route>
        </Router>  
    );
};

export default Button;
